script: |
  super -f text -I q512.spq | sort > q512.out

inputs:
  - name: q512.spq
    data: |
      SELECT b,
      a-b
      FROM t1 (FORMAT parquet)
      WHERE d NOT BETWEEN 110 AND 150
      AND a>b
      AND d>e;
  - name: t1

outputs:
  - name: q512.out
    data: |
      160	3
      181	1
      211	2
      232	2
      236	3
